import React from 'react'
import { Pressable } from "react-native";
import { styled } from "nativewind";

const MoreInfoPressable = styled(Pressable);


function Pressables( {title, onPress, className} ) {

  return (
    <MoreInfoPressable className={className} onPress={onPress}>{}</MoreInfoPressable>

  )
}

export default Pressables
